class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function maximumTripletValue($nums) {
        $max1 = $max2 = $max3 = PHP_INT_MIN;
        $min1 = $min2 = PHP_INT_MAX;

        foreach ($nums as $num) {
            if ($num > $max1) {
                $max3 = $max2;
                $max2 = $max1;
                $max1 = $num;
            } elseif ($num > $max2) {
                $max3 = $max2;
                $max2 = $num;
            } elseif ($num > $max3) {
                $max3 = $num;
            }

            if ($num < $min1) {
                $min2 = $min1;
                $min1 = $num;
            } elseif ($num < $min2) {
                $min2 = $num;
            }
        }

        return max(($max1 - $max2) * $max3, ($min1 - $min2) * $max1);
    }
}
